 return (
  <Layout title={"Hakkimizda"} headText={"Hakkimizda"}>
     <Row>
        <Col lg={4}>
        <Image src="/hakkimizda-image.jpg" thumbnail  />
        </Col>
        <Col lg={8}>
        <p className="text-primary">{hakkimizda}</p>
        <p className="text-primary">{hakkimizda2}</p>
        </Col>
     </Row>
  </Layout>
 );
}

